import PublierArticle from "./PublierArticle";
function PublierArticleHttp(){
      return <div
      className="col-sm-9  m-1 mt-4 me-4  bg-body"
      style={{
        height: "fitContent",
        boxShadow: "0px 0px 15px -2px 	#B0B0B0",
        borderRadius: "15px",
      }}
    >
          < PublierArticle />
    </div>
}
export default PublierArticleHttp ;
